// src/pages/documents/SharedWithMe.js
import React, { useState, useEffect } from 'react';
import documentService from '../../services/documentService';
import DocumentGrid from '../../components/documents/DocumentGrid';
import './DocumentPages.css';

const SharedWithMe = () => {
  const [documents, setDocuments] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const loadSharedDocuments = async () => {
      try {
        const docs = await documentService.getSharedDocuments();
        setDocuments(docs);
      } catch (error) {
        console.error('Failed to load shared documents:', error);
      } finally {
        setLoading(false);
      }
    };

    loadSharedDocuments();
  }, []);

  if (loading) {
    return <div className="loading-spinner">Loading...</div>;
  }

  return (
    <div className="documents-page">
      <div className="page-header">
        <h1>Shared with Me</h1>
      </div>

      <div className="documents-content">
        {documents.length === 0 ? (
          <div className="empty-state">
            <p>No documents have been shared with you yet.</p>
          </div>
        ) : (
          <DocumentGrid documents={documents} />
        )}
      </div>
    </div>
  );
};

export default SharedWithMe;
